import React, { Component } from 'react';

class RowTask extends Component {

    render() {    
        const { taks, key } = this.props;
        return (
            <tr>
                <td className="text-center">{key}</td>
                <td className="text-center">{taks.name}</td>
                <td className="text-center">{taks.date}</td>
                <td className="text-center">{taks.time}</td>
                <td className="text-center"> <input type="checkbox" name="" id="" /> </td>
                <td className="text-center"><button className="btn btn-danger">Eliminar</button></td>
            </tr>
        );
    }
}

export default RowTask;
